import React from 'react';
import './index.css'; 
import Deletebutton from "../button/Deletebutton.js"
import Input from '../input/Input.js';
const LessPlant = () => {
  return (
    <div className="float-bloc-list">
    <div className="greet" >
        <div className="title">Liste des plantes </div>
        <div className="subtitle">Cliquez sur le X pour supprimer la plante !</div>
    </div>

        <br></br>
        <div className="list-info-plt">
        <div className="plant-image">
            <img src="/assets/plant.jpg" alt="Plant" />
        </div>
        <div className="plant-name" style={{ width: '50%', marginTop: '0%' }}>Nom de la plante</div>

        <Deletebutton/>
        </div>
        <Input/>

    </div>
  );
};

export default LessPlant;
